import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Avatar from '@material-ui/core/Avatar';
import Divider from '@material-ui/core/Divider';

const useStyles = makeStyles({
  card: {
    minWidth: 770 ,
    minHeight:150,
    top: 80,
    position: 'relative'
  },
  bullet: {
    display: 'inline-block',
    margin: '0 2px',
    transform: 'scale(0.8)',
  },
  title: {
    fontSize: 14,
  },
  pos: {
    marginBottom: 12,
  },
  Pth: {
    
    backgroundColor: 'red',
    
  },
  Ptable: {
      padding: 15,
  }
});

export default function SimpleCard() {
  const classes = useStyles();
  const bull = <span className={classes.bullet}>•</span>;

  return (
    <Card className={classes.card}>
        
      <CardContent>
      
          <table className="Pth">
              <tr className="Pth,Ptable">
                <th><Avatar alt="not" src="/Pic/D1.jpg" className={classes.bigAvatar,classes.Tavatar} /></th>
                
                <th><Typography className={classes.title} color="textSecondary" gutterBottom>
                 Word of the Day
                </Typography></th>
                <th><Typography className={classes.title} color="textSecondary" gutterBottom>收货地址</Typography></th>
                <th><Typography className={classes.title} color="textSecondary" gutterBottom>优惠信息</Typography></th>
                <th><Typography className={classes.title} color="textSecondary" gutterBottom>会员信息</Typography></th>
              </tr>
              <Divider />

              <tr>
                  <td><Typography className={classes.title} color="textSecondary" gutterBottom>待付款</Typography></td>
                  <Divider  />
                  <td><Typography className={classes.title} color="textSecondary" gutterBottom>待发货</Typography></td>
                  <Divider orientation="vertical" />
                  <td><Typography className={classes.title} color="textSecondary" gutterBottom>待收货</Typography></td>
                  <Divider orientation="vertical" />
                  <td><Typography className={classes.title} color="textSecondary" gutterBottom>待评价</Typography></td>
                  <Divider orientation="vertical" />
                  <td><Typography className={classes.title} color="textSecondary" gutterBottom>退款</Typography></td>
              </tr>
        </table>
        
        
      </CardContent>
      <CardActions>
        <Button size="small">Learn More</Button>
      </CardActions>
    </Card>
  );
}
